import React from 'react';
import './App.css';
import Card from './Card';
import lightgrey from './lightgrey.png';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div id="">
        <Card 
          image={lightgrey} 
          title="SPORT SHIRT" 
          description="A comfortable and stylish grey sports t-shirt, perfect for workouts and casual wear." 
        />
        <Card 
          image={lightgrey} 
          title="CASUAL SHIRT" 
          description="A casual grey shirt, ideal for everyday wear and casual outings." 
        />
        <Card 
          image={lightgrey} 
          title="FORMAL SHIRT" 
          description="A formal grey shirt, perfect for office wear and formal occasions." 
        />
        </div>
      </header>
    </div>
  );
}

export default App;
